                        </TouchableOpacity>
                    </View>
                    <View style={styles.buttonsContainer1}>
                        <TouchableOpacity
                             style={styles.login}
                             onPress={() => navigation.navigate("Account")}
                             >
                            <Text style={styles.textSign1}>Cancel</Text>
